import React from 'react';
import logo from './logo.svg';
import PictureCapture from "./PictureCapture";
import './App.css';

class App extends React.Component {

  constructor(props){
    super(props);
    this.snapshot = this.snapshot.bind(this);
  }

  snapshot(image) {
    console.log(image);
  }

  render() {
    return (
      <div className="App">
        <PictureCapture
          onSnapshot={snapshot}
        />
      </div>
    );
  }
}

export default App;
